// components/Blog.js
import React from 'react';
import './Blog.css';

const Blog = () => {
  return (
    <div className="blog-container">
      <h2>Blog</h2>
      <div className="blog-post">
        <img src="https://placekitten.com/300/200" alt="Blog Post" />
        <h3>Sample Blog Title</h3>
        <p>This is a brief description of the blog post.</p>
        <a href="/blog/1">Read More</a>
      </div>
      {/* Repeat the above structure for more blog posts */}
    </div>
  );
}

export default Blog;
